import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './pages/login_page/Login';
import UploadBoth from './pages/UploadBoth/UploadBoth'; // Other components
import UploadSec1 from './pages/UploadSec/UploadSec1';
import UploadSec2 from './pages/UploadSec/UploadSec2';
import PA from './pages/PA/PA';
import Admin from './pages/Admin/Admin';
import AddUser from './pages/AddUser/adduser';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/upload-both" element={<UploadBoth />} />
        <Route path="/upload-sec1" element={<UploadSec1 />} />
        <Route path="/upload-sec2" element={<UploadSec2 />} />
        <Route path="/pa" element={<PA />} />
        <Route path="/" element={<Login />} />
        <Route path="/login" element={<Login />} />
        <Route path="/admin" element={<Admin />} />
        <Route path="/adduser" element={<AddUser />} />
      </Routes>
    </Router>
  );
};

export default App;
